import React from 'react';
import ReactDOM from 'react-dom/client';
import { BrowserRouter as Router, Route} from 'react-router-dom';
import App from './App';


const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
    <Router>
        <Route path="/" element={<App/>}/>
    </Router>

);
